import * as React from 'react';
import { View} from 'react-native';
import { Button } from 'react-native-web';
import { Header,Container,Title,TitleLeft,HeaderButtonLeft,HeaderButtonRight} from './styles';
import { Entypo } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';


function BreakfastScreen({navigation}) {
  return (
    <View>
      <Header>
        <HeaderButtonLeft>
          <Button onClick={handleSimpleButtonClick}>Click me!</Button>
          <Ionicons name="chevron-back" size={20} color="black" />
        </HeaderButtonLeft>
        <HeaderButtonRight>
          <Entypo name="dots-two-horizontal" size={20} color="#1D1617" />
        </HeaderButtonRight>
        <Title>Breakfast</Title>
      </Header>
      <Container>
        <TitleLeft>Category</TitleLeft>
        <div className="App">
          <input type="text" placeholder="Search Pancake" />
        </div>
        <Button
          title="Go to Bluebarry Pancake"
          onPress={() => navigation.navigate('Bluebarry Pancake')}
        />
      </Container>
    </View>
  );
}
export default BreakfastScreen;
